    "figure-3",nt"isopen": true,nt"url": null,nt"notes": "The Figure.tar.gz
    contains a directory for each WRF ensemble run. In these directories are *.csv files
    for each meteorology variable examined. These are comma delimited text files that
    contain statistics for each observation site. Also provided is an R script that
    reads these files (user would need to change directory pointers) and computes the
    variability of error and bias of the ensemble at each site and plots these for reproduction
    of figure 3.nnThis dataset is associated with the following publication:nGilliam
